"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[6837],{1888:(e,a,n)=>{n.r(a),n.d(a,{default:()=>i});var o=n(8e3);const t=[(0,o.uE)("<p>Ubique y seleccione en el menú de ADempiere, la carpeta “Gestión de Distribución”, luego seleccione la ventana “Registro de Peso”.</p><p>Menú de ADempiere</p><p>Imagen 1. Menú de ADempiere</p><p>Podrá visualizar la ventana “Registro de Peso”, con los registros de la ventana.</p><p>Ventana Registro de Peso</p><p>Imagen 2. Ventana Registro de Peso</p><p>Seleccione el icono “Registro Nuevo”, ubicado en la barra de herramientas de ADempiere, para crear un uevo registro en la ventana “Registro de Peso”.</p><p>Icono Registro Nuevo de la Ventana Registro de Peso</p><p>Imagen 3. Icono Registro Nuevo de la Ventana Registro de Peso</p><p>Seleccione en el campo “Organización”, la organización para la cual se encuentra realizando el documento.</p><p>Campo Organización de la Vantana Registro de Peso</p><p>Imagen 4. Campo Organización de la Ventana Registro de Peso</p><p>Introduzca en el campo “No. del Documento”, el número de identificación del documento que se encuentra realizando.</p><p>Campo No del Documento de la Vantana Registro de Peso</p><p>Imagen 5. Campo No. del Documento de la Vantana Registro de Peso</p><p>Seleccione el tipo de documento a generar en el campo “Tipo de Documento”, la selección de este define el comportamiento del documento que se esta elaborando, dicho comportamiento se encuentra explicado en el documento Tipo de Documento elaborado por ERPyA.</p><p>Campo Tipo de Documento de la Vantana Registro de Peso</p><p>Imagen 6. Campo Tipo de Documento de la Vantana Registro de Peso</p><p>Introduzca en el campo “F. Documento”, la fecha en la cual se encuentra realizando el documento.</p><p>Campo F Documento de la Vantana Registro de Peso</p><p>Imagen 7. Campo F. Documento de la Vantana Registro de Peso</p><p>Introduzca en el campo “No. Referencia”, el número de referencia correspondiente al registro que se encuentra realizando.</p><p>Campo No. Referencia de la Vantana Registro de Peso</p><p>Imagen 8. Campo No. Referencia de la Vantana Registro de Peso</p><p>Introduzca en el campo “Descripción”, una breve descripción del registro que se encuentra realizando.</p><p>Campo Descripción de la Vantana Registro de Peso</p><p>Imagen 9. Campo Descripción de la Vantana Registro de Peso</p><p>Al tildar el checklist “Transacción de Ventas”, se indica que el registro que se encuentra realizando esta asociado a una transacción de ventas de ADempiere.</p><p>Checklist Transacción de Ventas de la Vantana Registro de Peso</p><p>Imagen 10. Checklist Transacción de Ventas de la Vantana Registro de Peso</p><p>Al tildar el checklist “Transacción de Ventas”, es habilitado el campo “Orden de Flete”, para seleccionar la orden de flete correspondiente al registro que se encuentra realizando.</p><p>Campo Orden de Flete de la Ventana Registro de Peso</p><p>Imagen 11. Campo Orden de Flete de la Ventana Registro de Peso</p><p>El checklist “Peso de Referencia”, indica si un peso es únicamente de referencia.</p><p>Checklist Peso de Referencia de la Vantana Registro de Peso</p><p>Imagen 12. Checklist Peso de Referencia de la Vantana Registro de Peso</p><p>Note</p><p>Al seleccionar el checklist “Peso de Referencia”, son deshabilitados los campos “Orden de Venta” y “Línea Orden de Venta”.</p><p>Seleccione en el campo “Orden de Venta”, la orden de venta asociada al registro de peso que se encuentra realizando.</p><p>Campo Orden de Venta de la Vantana Registro de Peso</p><p>Imagen 13. Campo Orden de Venta de la Vantana Registro de Peso</p><p>Al seleccionar una orden de compra en el campo “Orden de Venta”, es habilitado el campo “Almacén”, donde debe seleccionar el almacén donde se encuentra ubicado el producto asociado a la orden seleccionada.</p><p>Campo Almacén de la Vantana Registro de Peso</p><p>Imagen 14. Campo Almacén de la Vantana Registro de Peso</p><p>Seleccione en el campo “Línea Orden de Venta”, la línea de la orden de venta seleccionada.</p><p>Campo Línea Orden de Venta de la Vantana Registro de Peso</p><p>Imagen 15. Campo Línea Orden de Venta de la Vantana Registro de Peso</p><p>Seleccione en el campo “Transportista”, la empresa de transporte asociada al registro de peso que se encuentra realizando.</p><p>Campo Transportista de la Vantana Registro de Peso</p><p>Imagen 16. Campo Transportista de la Vantana Registro de Peso</p><p>Seleccione en el campo “Conductor”, el conductor asociado al registro de peso que se encuentra realizando.</p><p>Campo Conductor de la Vantana Registro de Peso</p><p>Imagen 17. Campo Conductor de la Vantana Registro de Peso</p><p>Seleccione en el campo “Vehículo”, el vehículo asociado al registro de peso que se encuentra realizando.</p><p>Campo Vehículo de la Vantana Registro de Peso</p><p>Imagen 18. Campo Vehículo de la Vantana Registro de Peso</p><p>Seleccione la opción “Leer Peso (Desde Báscula)”, para cargar la información del peso del producto suministrada por la báscula.</p><p>Opción Leer Peso Desde Báscula de la Vantana Registro de Peso</p><p>Imagen 19. Opción Leer Peso Desde Báscula de la Vantana Registro de Peso</p><p>Seleccione el icono “Guardar Cambios”, ubicado en la barra de herramientas de ADempiere, para guardar el registro de los campos de la ventana “Registro de Peso”.</p><p>Icono Guardar Cambios de la Ventana Registro de Peso</p><p>Imagen 20. Icono Guardar Cambios de la Ventana Registro de Peso</p><p>Seleccione la opción “Completar”, ubicada en la parte inferior de la ventana “Registro de Peso”.</p><p>Opción Completar de la Ventana Registro de Peso</p><p>Imagen 21. Opción Completar de la Ventana Registro de Peso</p><p>Seleccione la acción “Completar” y la opción “OK”, para completar el documento “Registro de Peso”.</p><p>Acción Completar y Opción OK de la Ventana Registro de Peso</p><p>Imagen 22. Acción Completar y Opción OK de la Ventana Registro de Peso</p>",68)],r={},i=(0,n(3860).Z)(r,[["render",function(e,a){return(0,o.wg)(),(0,o.iD)("div",null,t)}]])},1970:(e,a,n)=>{n.r(a),n.d(a,{data:()=>o});const o=JSON.parse('{"key":"v-35c0df23","path":"/docs/distribution-management/weight.html","title":"Registro de Peso","lang":"en-US","frontmatter":{"title":"Registro de Peso","category":["Documentation"],"star":9,"sticky":9,"article":false,"summary":"Ubique y seleccione en el menú de ADempiere, la carpeta “Gestión de Distribución”, luego seleccione la ventana “Registro de Peso”. Menú de ADempiere Imagen 1. Menú de ADempiere Pod","head":[["meta",{"property":"og:url","content":"https://github.com/adempiere/adempiere-site.github.io/docs/distribution-management/weight.html"}],["meta",{"property":"og:title","content":"Registro de Peso"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-03-08T15:24:18.000Z"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"og:locale:alternate","content":"es-ES"}],["meta",{"property":"article:modified_time","content":"2023-03-08T15:24:18.000Z"}]]},"excerpt":"","headers":[],"git":{"createdTime":1678289058000,"updatedTime":1678289058000,"contributors":[{"name":"markinpadilla","email":"mjpc27@gmail.com","commits":1}]},"readingTime":{"minutes":3.05,"words":914},"filePathRelative":"docs/distribution-management/weight.md","localizedDate":"March 8, 2023"}')}}]);